import React from 'react';
import { Link, useNavigate} from 'react-router-dom';




const User = (props) => {

    const {_id,email,role} = props.user;
    const history = useNavigate();



    return (

     
            <div className='card'>
       
               
       
              
       
                <h3> id: {_id}</h3>
       
                <p>email : {email}</p>
                <h2>role: {role} </h2>
               
            </div>
         
    );

   }


   

export default User
